
<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0"/>
<title>P&P – v8c (password + borders + GM%)</title>
<style>
body{font-family:ui-sans-serif,system-ui,-apple-system,"Segoe UI",Roboto,Arial,sans-serif;margin:0;background:#f8fafc;color:#0f172a}
.wrap{max-width:1140px;margin:28px auto;padding:0 18px}
.title{display:flex;justify-content:space-between;align-items:center;margin-bottom:14px}
h1{margin:0;font-size:22px;font-weight:800} img.logo{height:40px;object-fit:contain}
.card{background:#fff;border:1px solid #e2e8f0;border-radius:14px;padding:16px;margin-bottom:14px;box-shadow:0 6px 20px rgba(2,6,23,.07)}
.grid{display:grid;gap:12px;grid-template-columns:repeat(auto-fit,minmax(220px,1fr))}
label{display:block;font-weight:700;font-size:12px;margin-bottom:6px}
input,select{width:100%;padding:12px;border:1px solid #e2e8f0;border-radius:10px;background:#fff} input[type=number]{text-align:right}
.row{display:flex;gap:10px;flex-wrap:wrap;align-items:center}
button{padding:10px 14px;border:0;border-radius:10px;background:#16a34a;color:#fff;font-weight:800;cursor:pointer}
button.gray{background:#334155} button.secondary{background:#0ea5e9} .small{font-size:12px;color:#64748b}
.table{width:100%;border-collapse:separate;border:1px solid #e2e8f0;border-radius:12px;overflow:hidden}
th,td{padding:10px 12px} thead tr{background:#f1f5f9} .green{color:#16a34a}
.modal-overlay{position:fixed;inset:0;background:rgba(15,23,42,.5);display:none;align-items:center;justify-content:center;padding:14px;z-index:1000}
.modal{background:#fff;border-radius:16px;border:1px solid #e2e8f0;box-shadow:0 6px 20px rgba(2,6,23,.07)}
.block{border:1px dashed #e2e8f0;border-radius:12px;padding:12px;margin-bottom:12px;background:#fff}
.meta{font-size:12px;color:#475569;margin-top:6px}
.badge{display:inline-flex;align-items:center;gap:6px;background:#eef2ff;border:1px solid #c7d2fe;color:#3730a3;padding:6px 10px;border-radius:999px;font-size:12px}
</style>

const ProductIndex = new Map();

function setStatus(msg){ document.getElementById('statusData').textContent = msg; }
function setLockUI(){
  const locked = usingEmbedded && !landedUnlocked;
  document.getElementById('lockArea').style.display = usingEmbedded ? '' : 'none';
  document.getElementById('lockNote').textContent = locked ? "Landed Cost autofill is locked (embedded data)" : "Landed Cost is visible";
  document.getElementById('unlockBtn').textContent = locked ? "Unlock Landed Cost" : "Unlocked";
}

(function initDatalist(){
  const dl=document.getElementById('codeList'); let n=0;
  EMBEDDED.forEach(r=>{ if(r && r.code){ const c=String(r.code).trim(); ProductIndex.set(c,r); const o=document.createElement('option'); o.value=c; dl.appendChild(o); n++; } });
  setStatus(`Loaded ${n} rows (embedded).`);
  document.getElementById('dsState').textContent='embedded';
  setLockUI();
})();

// Upload new master sheet -> no password required (autofill allowed)
document.getElementById('masterFile').addEventListener('change', async (e)=>{
  const file=e.target.files[0]; if(!file) return;
  try{
    const buf=await file.arrayBuffer();
    const wb=await XlsxPopulate.fromDataAsync(buf);
    const sh=wb.sheet(0);
    const used=sh.usedRange(); const vals=used?used.value():null;
    if(!Array.isArray(vals)||!vals.length) throw new Error('No data');
    const hdr=vals[0].map(v=>String(v||'').toLowerCase().trim());
    let cCode=hdr.findIndex(t=> t==='code' || (t.includes('product')&&t.includes('code')));
    let cQty =hdr.findIndex(t=> t==='qty' || t==='quantity' || t.includes('qty'));
    let cCost=hdr.findIndex(t=> t==='landed' || t==='cost' || (t.includes('landed')&&t.includes('cost')));
    if(cCode<0)cCode=0; if(cQty<0)cQty=1; if(cCost<0)cCost=2;
    ProductIndex.clear(); const dl=document.getElementById('codeList'); dl.innerHTML="";
    let n=0;
    for(let r=1;r<vals.length;r++){ const row=vals[r]||[]; const code=String(row[cCode]||'').trim(); if(!code) continue;
      const rec={code, qty:Number(row[cQty]||0)||0, landed:Number(row[cCost]||0)||0};
      ProductIndex.set(code, rec); const opt=document.createElement('option'); opt.value=code; dl.appendChild(opt); n++;
    }
    setStatus(`Loaded ${n} rows (uploaded).`); document.getElementById('dsState').textContent='uploaded';
    usingEmbedded=false; landedUnlocked=true; setLockUI();
  }catch(err){
    console.error(err); setStatus('Failed to read the sheet.');
  }
});

// Unlock flow (only affects auto-fill from embedded index)
document.getElementById('unlockBtn').addEventListener('click',()=>{
  if(!usingEmbedded) return; // nothing to unlock when using uploaded data
  document.getElementById('pwOverlay').style.display='flex';
});
document.getElementById('closePw').addEventListener('click',()=>{ document.getElementById('pwOverlay').style.display='none'; });
document.getElementById('pwConfirm').addEventListener('click',doUnlock);
document.getElementById('pw').addEventListener('keydown',e=>{ if(e.key==='Enter') doUnlock(); });

function doUnlock(){
  const v=(document.getElementById('pw').value||'').trim();
  if(v===PASSWORD){ landedUnlocked=true; document.getElementById('pwErr').style.display='none'; document.getElementById('pwOverlay').style.display='none'; setLockUI();  maybeAutofillMain(); maybeAutofillMain(); }
  else { document.getElementById('pwErr').style.display='block'; }
}

function maybeAutofillMain(){
  if(!(usingEmbedded && landedUnlocked)) return;
  const code=(document.getElementById('prod').value||'').trim();
  const rec=ProductIndex.get(code);
  if(rec && rec.landed!=null){ document.getElementById('landed').value=Math.round(Number(rec.landed)||0); updatePreview(); }
}

// Live preview (main)
function n(v){return isNaN(v)||v===null||v===''?0:Number(v)}
function fmt(x){return new Intl.NumberFormat('en-LK',{maximumFractionDigits:0}).format(Math.round(n(x))) }
function pct(x){return isFinite(x)?(Math.round(x*10)/10).toFixed(1)+'%':""}
function updatePreview(){
  const cash=n(document.getElementById('cash').value), promo=n(document.getElementById('promo').value),
        landed=n(document.getElementById('landed').value||0), vat=(document.getElementById('vat').value||'Y').trim();
  const vatPct=vat==='Y'?0.18:0, discounted=Math.max(0,cash-promo), vatVal=Math.round(discounted*vatPct/(1+vatPct)),
        sscl=Math.floor((discounted-vatVal)*0.0125), net=discounted-vatVal-sscl, gm=net-landed-net*0.025;
  document.getElementById('mopCell').textContent=fmt(discounted);
  document.getElementById('gmVal').textContent=fmt(gm);
  document.getElementById('gmPct').textContent=pct(net?gm/net*100:0);
}
['prod','qty','cash','promo','landed','vat','comm','channel'].forEach(id=>{
  const el=document.getElementById(id); el.addEventListener('input',updatePreview); el.addEventListener('change',updatePreview);
});
updatePreview();
document.getElementById('prod').addEventListener('change',()=>{
  const code=(document.getElementById('prod').value||'').trim();
  const rec=ProductIndex.get(code);
  if(rec){ if(rec.qty!=null) document.getElementById('qty').value=Math.round(rec.qty);
          if(landedUnlocked) document.getElementById('landed').value=Math.round(Number(rec.landed)||0);
          else document.getElementById('landed').value=document.getElementById('landed').value; }
  updatePreview();
});

// Excel builder + borders (same as v8b)
async function buildSheet(sheet, ctx){
  const green="D9F99D", yellow="FDE68A", blue="BAE6FD", bcol="D1D5DB";
  const prod=(ctx.prod||""), qty=Number(ctx.qty||0), cash=Number(ctx.cash||0), promo=Number(ctx.promo||0),
        landed=Number(ctx.landed||0), vat=(ctx.vat||"Y"), comm=(ctx.comm||""), channel=(ctx.channel||"Retail");
  sheet.name(prod?prod.slice(0,28):"P&P");
  sheet.column("A").width(56); sheet.column("B").width(12); sheet.column("C").width(18); sheet.column("D").width(12);

  const S = (addr, styles) => sheet.cell(addr).style(styles);

  S("A1", {bold:true,fontColor:"FF0000"}).value("This document contains highly confidential information and is strictly for internal use only.");
  S("A2", {bold:true,fontColor:"FF0000"}).value("Do not share without prior approval from the Pricing Department.");
  S("A4", {bold:true}).value("PRICE & PROFITABILITY CALCULATION (P&P)");
  S("D4", {bold:true}).value(channel);

  S("A6", {}).value('VAT APPLICABILITY (IF APPLICABLE "Y" ELSE "N")');
  S("D6", {fill:green,bold:true}).value(vat);
  S("A7", {}).value("PRODUCT CATEGORY FOR COMMISSION CALCULATION - M-Sewing Machines, S- Solar, Blank - Others");
  S("D7", {fill:green,bold:true}).value(comm);

  S("A9", {}).value("PRODUCT CODE"); S("C9", {fill:green,bold:true}).value(prod);
  S("A10", {}).value("QTY (info)");   S("C10", {fill:green,numberFormat:"#,##0"}).value(qty);

  S("C11", {bold:true}).value("Rs."); S("D11", {bold:true}).value("%");

  S("A12", {}).value("CASH PRICE / SPECIAL PRICE"); S("C12", {fill:green,numberFormat:"#,##0"}).value(cash);
  S("A13", {}).value("PROMO DISCOUNT / FINAL SLAB DISCOUNT"); S("C13", {fill:green,numberFormat:"#,##0"}).value(promo);
  S("A14", {}).value("DISCOUNTED PRICE"); S("C14", {numberFormat:"#,##0"}).formula("C12-C13");

  S("A15", {bold:true}).value("SALES TAXES");
  S("A16", {}).value("Vat"); S("D16", {fill:yellow,numberFormat:"0.0%"}).formula('IF(D6="Y",0.18,0)');
  S("C16", {numberFormat:"#,##0"}).formula("ROUND(C14*D16/(1+D16),0)");
  S("A17", {}).value("SSCL"); S("D17", {fill:yellow,numberFormat:"0.000%"}).value(0.0125);
  S("C17", {numberFormat:"#,##0"}).formula("ROUNDDOWN((C14-C16)*D17,0)");

  S("A19", {}).value("NET SELLING PRICE"); S("C19", {numberFormat:"#,##0"}).formula("C14-C16-C17");
  S("D19", {numberFormat:"0.0%"}).value(1);

  S("A21", {}).value("LANDED COST/FACTORY TP/LOCAL BUY PRICE (WITHOUT VAT)"); S("C21", {fill:green,numberFormat:"#,##0"}).value(landed);
  S("D21", {numberFormat:"0.0%"}).formula("IF(C19>0, C21/C19, 0)");
  S("A22", {}).value("OTHER DIRECT COSTS (eg. AC Installation cost, helmet, Jacket)"); S("C22", {numberFormat:"#,##0"}).value(0);
  S("D22", {numberFormat:"0.0%"}).formula("IF(C19>0, C22/C19, 0)");
  S("A23", {}).value("REBATES (Enter Rebates per Unit as a plus value)"); S("C23", {fill:blue,numberFormat:"#,##0"}).value(0);
  S("D23", {numberFormat:"0.0%"}).formula("IF(C19>0, C23/C19, 0)");
  S("A24", {}).value("TRANSPORT COST ( FURNITURE - 4%, COMPUTER .75%, OTHER 2.5%)"); S("D24", {fill:yellow,numberFormat:"0.00%"}).value(0.025);
  S("C24", {numberFormat:"#,##0"}).formula("C19*D24");

  S("A26", {bold:true}).value("GROSS MARGIN");
  S("C26", {bold:true,numberFormat:"#,##0"}).formula("C19 - C21 - C22 + C23 - C24");
  S("D26", {bold:true,numberFormat:"0.0%"}).formula("IF(C19>0, C26/C19, 0)");

  S("A28", {bold:true}).value("VARIABLE COSTS");
  S("A29", {}).value("Royalty");            S("D29", {fill:yellow,numberFormat:"0.00%"}).value(0.01);  S("C29", {numberFormat:"#,##0"}).formula("C19*D29");
  S("A30", {}).value("Selling Commission"); S("D30", {fill:yellow,numberFormat:"0.00%"}).value(0.045); S("C30", {numberFormat:"#,##0"}).formula("C19*D30");
  S("A31", {}).value("Selling Bonus");      S("D31", {fill:yellow,numberFormat:"0.00%"}).value(0);     S("C31", {numberFormat:"#,##0"}).formula("C19*D31");
  S("A32", {}).value("PF & TF");            S("D32", {fill:"D9F99D",numberFormat:"0.00%"}).value(0.15);   S("C32", {numberFormat:"#,##0"}).formula("(C30+C31)*D32");
  S("A33", {}).value("Product Bonus");      S("D33", {fill:"D9F99D",numberFormat:"0.00%"}).value(0);      S("C33", {numberFormat:"#,##0"}).formula("C19*D33");
  S("A34", {}).value("Warranty");           S("D34", {fill:yellow,numberFormat:"0.00%"}).value(0.006); S("C34", {numberFormat:"#,##0"}).formula("C19*D34");
  S("A35", {}).value("CC Commission");      S("D35", {fill:yellow,numberFormat:"0.00%"}).value(0.0075);S("C35", {numberFormat:"#,##0"}).formula("C19*D35");
  S("C36", {numberFormat:"#,##0"}).formula("SUM(C29:C35)");
  S("D36", {numberFormat:"0.0%"}).formula("IF(C19>0, C36/C19, 0)");

  S("A37", {bold:true}).value("VARIABLE MARGIN");
  S("C37", {bold:true,numberFormat:"#,##0"}).formula("C26 - C36");
  S("D37", {bold:true,numberFormat:"0.0%"}).formula("IF(C19>0, C37/C19, 0)");

  S("A39", {bold:true}).value("ALLOCATION OF SEMI AND FIXED COSTS");
  S("A40", {}).value("SEMI VARIABLE S&A"); S("D40", {fill:yellow,numberFormat:"0.00%"}).value(0.06);  S("C40", {numberFormat:"#,##0"}).formula("C19*D40");
  S("A41", {}).value("PERIOD EXPENSES");   S("D41", {fill:yellow,numberFormat:"0.00%"}).value(0.125); S("C41", {numberFormat:"#,##0"}).formula("C19*D41");
  S("A42", {}).value("CONTRIBUTION BEFORE INT. AND  TAX"); S("C42", {numberFormat:"#,##0"}).formula("C26 - C36 - C40 - C41");

  S("A43", {}).value("INTEREST"); S("D43", {fill:yellow,numberFormat:"0.00%"}).value(0.035); S("C43", {numberFormat:"#,##0"}).formula("C21*D43");
  S("A44", {}).value("CONTRIBUTION BEFORE TAX"); S("C44", {numberFormat:"#,##0"}).formula("C42 - C43");
  S("A45", {}).value("TAX"); S("D45", {fill:yellow,numberFormat:"0.00%"}).value(0.32); S("C45", {numberFormat:"#,##0"}).formula("IF(C44<0, 0, C44*D45)");
  S("A46", {bold:true}).value("NET CONTRIBUTION AFTER TAX"); S("C46", {bold:true,numberFormat:"#,##0"}).formula("C44 - C45");

  
  try {
    const cols = ["A","B","C","D"];
    for (let r = 4; r <= 46; r++) {
      cols.forEach((col) => {
        const addr = col + r;
        sheet.cell(addr).style("border", {
          top:    { style: "medium", color: "000000" },
          left:   { style: "medium", color: "000000" },
          right:  { style: "medium", color: "000000" },
          bottom: { style: "medium", color: "000000" }
        });
      });
    }
  } catch(e) { /* keep export robust even if styling fails */ }
}
// Single export
document.getElementById('exportSingle').addEventListener('click', async ()=>{
  try{
    const ctx = {
      prod:(document.getElementById('prod').value||'').trim(),
      qty:Number(document.getElementById('qty').value||0),
      cash:Number(document.getElementById('cash').value||0),
      promo:Number(document.getElementById('promo').value||0),
      landed:Number(document.getElementById('landed').value||0),
      vat:(document.getElementById('vat').value||'Y').trim(),
      comm:(document.getElementById('comm').value||'').trim(),
      channel:(document.getElementById('channel').value||'Retail').trim()
    };
    const wb=await XlsxPopulate.fromBlankAsync(); const sh=wb.sheet(0); await buildSheet(sh, ctx);
    const blob=await wb.outputAsync(); const url=URL.createObjectURL(blob);
    const a=document.createElement('a'); a.href=url; a.download='PP Format_'+(ctx.prod||'export')+'.xlsx';
    document.body.appendChild(a); a.click(); a.remove(); setTimeout(()=>URL.revokeObjectURL(url),1500);
  }catch(e){ console.error('Export failed', e); alert('Export failed. See console.'); }
});

// Batch with GM% preview
function blockHtml(i){
  return `
  <div class="block" data-idx="${i}">
    <h4 style="margin:0 0 8px 0;font-size:14px">Product ${i+1}</h4>
    <div class="grid" style="grid-template-columns:repeat(auto-fit,minmax(170px,1fr))">
      <div><label>Product Code</label><input id="b_prod_${i}" list="codeList"/></div>
      <div><label>Qty</label><input id="b_qty_${i}" type="number" step="1" min="0"/></div>
      <div><label>Cash / Special Price (Rs.)</label><input id="b_cash_${i}" type="number" step="1" min="0"/></div>
      <div><label>Promo Discount (Rs.)</label><input id="b_promo_${i}" type="number" step="1" min="0"/></div>
      <div><label>Landed Cost (without VAT) (Rs.)</label><input id="b_landed_${i}" type="number" step="1" min="0"/></div>
      <div><label>VAT (Y/N)</label><select id="b_vat_${i}"><option>Y</option><option>N</option></select></div>
      <div><label>Commission</label><select id="b_comm_${i}"><option value=""></option><option>M</option><option>S</option></select></div>
      <div><label>Channel</label><select id="b_channel_${i}"><option>Retail</option><option>Wholesale</option></select></div>
    </div>
    <div class="meta">MOP: <strong id="b_mop_${i}">—</strong> | GM: <strong id="b_gm_${i}">—</strong> | GM%: <strong id="b_gmp_${i}">—</strong></div>
  </div>`;
}
function blockCompute(i){
  const cash=Number(document.getElementById(`b_cash_${i}`).value||0),
        promo=Number(document.getElementById(`b_promo_${i}`).value||0),
        landed=Number(document.getElementById(`b_landed_${i}`).value||0),
        vat=(document.getElementById(`b_vat_${i}`).value||'Y').trim();
  const vatPct=vat==='Y'?0.18:0, disc=Math.max(0,cash-promo), vatVal=Math.round(disc*vatPct/(1+vatPct)),
        sscl=Math.floor((disc-vatVal)*0.0125), net=disc-vatVal-sscl, gm=net-landed-net*0.025, gmp=net?gm/net*100:0;
  document.getElementById(`b_mop_${i}`).textContent=new Intl.NumberFormat('en-LK').format(Math.round(disc));
  document.getElementById(`b_gm_${i}`).textContent=new Intl.NumberFormat('en-LK').format(Math.round(gm));
  document.getElementById(`b_gmp_${i}`).textContent=isFinite(gmp)?(Math.round(gmp*10)/10).toFixed(1)+'%':'—';
}
function attachBlock(i){
  ["prod","qty","cash","promo","landed","vat","comm","channel"].forEach(f=>{
    const el=document.getElementById(`b_${f}_${i}`); if(el){ el.addEventListener('input',()=>blockCompute(i)); el.addEventListener('change',()=>blockCompute(i)); }
  });
  const pc=document.getElementById(`b_prod_${i}`);
  if(pc) pc.addEventListener('change',()=>{
    const rec=ProductIndex.get((pc.value||'').trim());
    if(rec){
      if(rec.qty!=null) document.getElementById(`b_qty_${i}`).value=Math.round(rec.qty);
      if(landedUnlocked || !usingEmbedded) document.getElementById(`b_landed_${i}`).value=Math.round(Number(rec.landed)||0);
    }
    blockCompute(i);
  });
  blockCompute(i);
}
document.getElementById('openBatch').addEventListener('click',()=>{
  const body=document.getElementById('batchBody'); body.innerHTML=Array.from({length:6},(_,i)=>blockHtml(i)).join('');
  for(let i=0;i<6;i++) attachBlock(i);
  document.getElementById('overlay').style.display='flex';
});
document.getElementById('closeOverlay').addEventListener('click',()=>{ document.getElementById('overlay').style.display='none'; });

// Batch ZIP
document.getElementById('exportBatchZip').addEventListener('click', async ()=>{
  try{
    const zip=new JSZip(); let idx=1;
    for(let i=0;i<6;i++){
      const ctx = {
        prod:(document.getElementById(`b_prod_${i}`)?.value||'').trim(),
        qty:Number(document.getElementById(`b_qty_${i}`)?.value||0),
        cash:Number(document.getElementById(`b_cash_${i}`)?.value||0),
        promo:Number(document.getElementById(`b_promo_${i}`)?.value||0),
        landed:Number(document.getElementById(`b_landed_${i}`)?.value||0),
        vat:(document.getElementById(`b_vat_${i}`)?.value||'Y').trim(),
        comm:(document.getElementById(`b_comm_${i}`)?.value||'').trim(),
        channel:(document.getElementById(`b_channel_${i}`)?.value||'Retail').trim()
      };
      if(!ctx.prod) continue;
      const wb=await XlsxPopulate.fromBlankAsync(); const sh=wb.sheet(0); await buildSheet(sh, ctx);
      const blob=await wb.outputAsync(); const ab=await blob.arrayBuffer();
      zip.file(`PP Format_${ctx.prod}_${ctx.channel.charAt(0).toUpperCase()}${ctx.channel.slice(1).toLowerCase()}.xlsx`, new Uint8Array(ab)); idx++;
    }
    const zipBlob=await zip.generateAsync({type:'blob'}); const url=URL.createObjectURL(zipBlob);
    const a=document.createElement('a'); a.href=url; a.download='PP_Batch_Separate_Files.zip'; document.body.appendChild(a);
    a.click(); a.remove(); setTimeout(()=>URL.revokeObjectURL(url),1500);
  }catch(e){ console.error('ZIP export failed', e); alert('ZIP export failed. See console.'); }
});
</script>
